import React from "react";
import "./secondsection.css";
import guest from "./guest.png";
function Secondsection() {
  return (
    <div className="secondsection">
      <h1>#1 IS ON AUCTION NOW!</h1>
      <h2>MOAR #1</h2>
      <p className="moartext">
        Legendary MOAR#1 is now auctioning off on OPENSEA!<br></br>
        This suited man with a gun is usually seen on the artistâ€™s notable
        works, which makes it the most valuable and sought-after <br></br>pfp
        from the 5,555 NFT collection undoubtedly.<br></br>
        Winner of this auction gets airdropped token of identical legendary 3D
        avatar in phase 2 as well as a painted canvas (H273 x <br></br> W220mm).
        <br></br>
        All proceeds will go to "MOAR" future DAO development.
      </p>
      <div className="bidnowbtn">
        <h1>BID NOW ON</h1>
      </div>

      <section className="moarguest">
        <div className="guestcontent">
          <img src={guest} alt="guest" />
        </div>
      </section>
    </div>
  );
}

export default Secondsection;
